from typing import List
import sys
from collections import deque

class Solution:
    def updateMatrix(self, mat: List[List[int]]) -> List[List[int]]:
        def __approach1():
            r, c = len(mat), len(mat[0])

            def __distNearestZero(ri, cj):
                visited = [[False]*c for _ in range(r)]
                dxArr, dyArr = [0,0,1,-1], [1,-1,0,0]

                dq = deque()
                dq.append((ri, cj, 0))
                visited[ri][cj]=True

                while len(dq):
                    x, y, d = dq.popleft()
                    if mat[x][y]==0:
                        return d
                    
                    for k in range(4):
                        dx = x + dxArr[k]
                        dy = y + dyArr[k]

                        if dx>=0 and dx<r and dy>=0 and dy<c and not visited[dx][dy]:
                            dq.append((dx, dy, d+1))
                            visited[dx][dy] = True
                return sys.maxsize
            
            res = [[0]*c for _ in range(r)]
            for ri in range(r):
                for cj in range(c):
                    if mat[ri][cj]!=0:
                        res[ri][cj] = __distNearestZero(ri, cj)
            return res
        
        def __optimizedApproach():
            r, c = len(mat), len(mat[0])
            res = [[0]*c for _ in range(r)]
            visited = [[False]*c for _ in range(r)]

            dq = deque()
            
            for ri in range(r):
                for cj in range(c):
                    if mat[ri][cj]==0:
                        dq.append((ri, cj, 0))
                        visited[ri][cj]=True
            
            dx, dy = [1,-1,0,0], [0,0,1,-1]
            while len(dq):
                x, y, d = dq.popleft()
                res[x][y] = d

                for i in range(4):
                    nx = x + dx[i]
                    ny = y + dy[i]

                    if nx>=0 and nx<r and ny>=0 and ny<c and not visited[nx][ny]:
                        dq.append((nx, ny, d+1))
                        visited[nx][ny] = True
            return res
        return __optimizedApproach()


                

